/* eslint-disable jsx-a11y/anchor-has-content */
import { ReactComponent as GithubIcon } from 'assets/img/github.svg'

function Navbar() {
    return (
        <header>
            <nav className="container">
                <div className="">
                    <h1>DSMovie</h1>
                    <a href="https://github.com/alexandre-medeiros" />
                    <GithubIcon />
                </div>
            </nav>
        </header>

    );
}

export default Navbar;
